	.response {

	.error {
		background-color: rgb(255, 200, 200);
	}

	.highlight {
		background-color: rgb(200, 200, 255);
	}
</style>

	<div class="output"></div>
	<div class="output"></div>

<script>
	let text = document.querySelector('textarea');
	let windowInput = document.querySelector('input');
	let divs = document.querySelectorAll('.output');
	let countEl = document.querySelector('#count');

	let update = () => {
		let datas = JSON.parse(text.value);
		[datas.post, datas.get]
			.map((data, i) => [data, divs[i]])
			.forEach(([data, div]) => {
				while (div.firstChild)
					div.firstChild.remove();

				data.forEach(d => {
					let {rules, states} = d.rateLimitHeaders || {};
					let error = states?.some(state => state.match(/\d+:\d+:[^0]/));
					let response = d.type === 'response';

					let row = document.createElement('div');
					row.textContent = response ?
						`${Math.round(d.time) / 1000}, ${d.delays.join(', ')}, max: ${d.delay}` :
						`${Math.round(d.time) / 1000} ${d.type}`;
					if (error)
						row.classList.toggle('error');
					row.classList.toggle('response', response);
					row.title = JSON.stringify(d, null, 2);
					div.appendChild(row);

					row.addEventListener('mouseover', () => {
						let window = windowInput.value;
						let matches = data.filter((dd, i) => {
							let delta = d.time - dd.time;
							let x = delta > 0 && delta < window * 1000;
							div.children[i].classList.toggle('highlight', x);
							return x;
						});
						countEl.textContent = `${matches.filter(m => m.type === 'request').length} requests, ${matches.filter(m => m.type === 'response').length} responses`;
					});
				});
			});
	};
